import re
import base64
from time import time


def dec(a):
    return base64.b64decode(a.encode('utf-8')).decode('utf-8')


def shift(lst, x):
    x = x - 1
    while x:
        tmp = lst[1:]
        tmp.extend(lst[0:1])
        lst = tmp
        x = x - 1
    return lst


